import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function App() {
  return (
    <div className='App'>
      <Container fluid>
        <Row>
          <Col className='align-center'>
            <h1>React Dictionary</h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
